// UUID generator compatible with n8n
const generateUUID = () => {
  return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function(c) {
    const r = Math.random() * 16 | 0,
          v = c === 'x' ? r : (r & 0x3 | 0x8);
    return v.toString(16);
  });
};

const input = $input.item.json;

// Normalize to ISO date (YYYY-MM-DD) or null
const normalizeDate = (value) => {
  if (!value) return null;
  const date = new Date(value);
  return isNaN(date) ? null : date.toISOString().split("T")[0];
};

// Safely extract agreements
const agreements = Array.isArray(input.temp_deal_data?.master_agreements)
  ? input.temp_deal_data.master_agreements
  : [];

// Generate AI job ID if missing
const ai_extraction_job_id = input.job_id??generateUUID();

// Build output payload
const output = {
  ai_extraction_job_id,
  book_number: input.book_number,
  active: input.temp_deal_data?.active ?? false,
  artist_number: input.temp_deal_data?.artist_number ?? input.temp_deal_data?.artist?.number ?? null,
