  master_credits: agreements.flatMap(agreement =>
    Array.isArray(agreement.credits)
      ? agreement.credits.map(c => c.credit)
      : []
  ),
  instruments: agreements.flatMap(agreement =>
    Array.isArray(agreement.credits)
      ? agreement.credits.map(c => c.instrument).filter(inst => inst !== null)
      : []
  ),
  master_agreements: agreements.map(agreement => {
    const credits = Array.isArray(agreement.credits) ? agreement.credits : [];
    return {
      person_number: agreement.person_number,
      master_number: agreement.master_number,
      deal_number: input.book_number,
      master_name: agreement.master_name ?? null,
      master_version_subtitle: agreement.master_version_subtitle ?? null,
      type: agreement.type ?? null,
      master_credits: credits.map(c => c.credit),
      instruments: credits.map(c => c.instrument).filter(inst => inst !== null),
      status: agreement.status ?? null,
      effective_date: normalizeDate(agreement.effective_date),
      upstream_royalty: agreement.upstream_royalty ?? null,
      upstream_royalty_type: agreement.upstream_royalty_type ?? null,
      upstream_fee: agreement.upstream_fee ?? null,
      upstream_fee_currency: agreement.upstream_fee_currency ?? null,
      fee: agreement.fee ?? null,
      master_royalty: agreement.master_royalty ?? null,
      master_royalty_type: agreement.master_royalty_type ?? null,
      neighboring_rights_royalty: agreement.neighboring_rights_royalty ?? null,
      sx_percentage: agreement.sx_percentage ?? null,
