// N8N Code Node - Route Processing Logic
// Input data comes from $input.all() in n8n
const inputData = $input.all();
let result = [];

// Handle empty input or input with empty object
if (inputData.length === 0 || (inputData.length === 1 && Object.keys(inputData[0].json || {}).length === 0)) {
    result = [{
        route: "discard",
        deal_number: null,
        deal_id: null,
        book_id: null
    }];
    return result.map(item => ({ json: item }));
}

// Sort by score to ensure we get the top results
const sortedData = inputData.sort((a, b) => a.json.score - b.json.score);

// Add deduplication based on deal_id and deal_number
const uniqueDeals = [];
const seenDeals = new Set();

for (const item of sortedData) {
    const dealKey = `${item.json.document.metadata.deal_id}_${item.json.document.metadata.deal_number}`;
    if (!seenDeals.has(dealKey)) {
        seenDeals.add(dealKey);
        uniqueDeals.push(item);
    }
}

// Get the lowest score (top-most result)
const topScore = uniqueDeals[0].json.score;

// Check if there's a confirmed_by_id with value true in any of the input objects
const hasConfirmedById = inputData.some(item => item.json.confirmed_by_id === true);

// Check if deal_search_skip is true (deal_next_step === "create_new")
const deal_search_skip = inputData.some(item => item.json.deal_next_step === "create_new");

// If deal_search_skip is true, immediately discard
if (deal_search_skip) {
    // Get the top most input for metadata (if available)
    const topResult = uniqueDeals[0].json;

    result = [{
        route: "discard",
        deal_number: topResult.document?.metadata?.deal_number || null,
        deal_id: topResult.document?.metadata?.deal_id || null,
        book_id: topResult.document?.metadata?.book_id || null,
        reason: "deal_search_skip"
    }];

    return result.map(item => ({ json: item }));
}

// Apply routing logic based on score and confirmed_by_id
if (topScore <= 0.14 || hasConfirmedById) {
    // Get the top most input (closest to 0) and return as single object
    // This now applies when score <= 0.10 OR when confirmed_by_id is true
    const topResult = uniqueDeals[0].json;

    result = [{
        route: "proceed",
        deal_number: topResult.document.metadata.deal_number,
        deal_id: topResult.document.metadata.deal_id,
        book_id: topResult.document.metadata.book_id,
        confirmed_by_id: hasConfirmedById,
        score: topResult.score
    }];

} else if (topScore > 0.14 && topScore < 0.35) {
    // Filter top-3 results and return as list of objects
    const top3Results = uniqueDeals.slice(0, 3);

    result = top3Results.map(item => ({
        route: "confirm",
        deal_number: item.json.document.metadata.deal_number,
        deal_id: item.json.document.metadata.deal_id,
        book_id: item.json.document.metadata.book_id,
        score: item.json.score
    }));

} else { // score >= 0.35
    // Get the top most input (closest to 0) and return as single object
    const topResult = uniqueDeals[0].json;

    result = [{
        route: "discard",
        deal_number: topResult.document.metadata.deal_number,
        deal_id: topResult.document.metadata.deal_id,
        book_id: topResult.document.metadata.book_id,
        score: topResult.score
    }];
}

// Sort final results by score (lowest distance on top)
result.sort((a, b) => a.score - b.score);

// Return the result for n8n
return result.map(item => ({ json: item }));

// Extract the search data from the first array element
const inputData = $json.data;
const searchData = inputData.task_metadata;
const personData = inputData.person_verification;

// Light normalization function (same as used for embeddings)
const lightNormalize = (text) => {
  if (!text || typeof text !== 'string') return '';
  return text
    .trim()
    .replace(/\s+/g, ' ')  // Multiple spaces to single space
    .replace(/[^\w\s-.,]/g, ' ')  // Keep basic punctuation
    .replace(/\s+/g, ' ')
    .trim();
};

// Create search query parts following same structure as embeddings
const queryParts = [];

// Add person name with context
const personName = lightNormalize(personData.person_legal_name) || lightNormalize(personData.person_performer_name);
if (personName) {
  queryParts.push(`${personName}`);
}

// Add artist name with context
const artistName = lightNormalize(searchData.artist_name);
if (artistName) {
  queryParts.push(`${artistName}`);
}

// Process masters array into comma-separated string
let mastersString = '';
if (searchData.masters && Array.isArray(searchData.masters) && searchData.masters.length > 0) {
  // Filter out empty values and normalize each master
  const normalizedMasters = searchData.masters
    .filter(master => master && master.trim() !== '')
    .map(master => lightNormalize(master))
    .filter(master => master !== '');

  if (normalizedMasters.length > 0) {
    mastersString = normalizedMasters.join(', ');
    queryParts.push(`${mastersString}`);
  }
}

// Join with natural separators (same as embedding format)
const searchQuery = queryParts.join(' | ');

// Return n8n compatible output
return [{
  json: {
    query: searchQuery,
    metadata: {
      person_name: personName,
      person_role: personData?.role || personData.person_role || '',
      artist_name: artistName,
      masters: mastersString,
      book_id: personData?.book_id || personData.book_id || '',
      book_number: personData?.book_number || '',
      deal_number: searchData.deal_number || '',
      deal_id: searchData.deal_id || '',
      deal_type: searchData.deal_type || '',
      deal_next_step: searchData.deal_next_step,
      verification_status: personData?.verification_status || ''
    },
    hasValidContent: queryParts.length > 0
  }
}];

// Get the input data
const inputData = $input.all()[0].json;

// Initialize output object
let output = {
  deal_search_output: "",
  next_route: "",
  deal_metadata: []
};

// Helper function to format currency
function formatCurrency(amount, currency) {
  return `${currency} ${parseFloat(amount).toFixed(2)}`;
}

// Helper function to format deal terms into structured string
function formatDealTerms(deal) {
  const terms = [];

  terms.push(`**Deal ID:** ${deal.id}`);
  terms.push(`**Title:** ${deal.title}`);
  terms.push(`**Status:** ${deal.status}`);
  terms.push(`**Payment Status:** ${deal.payment_status}`);
  terms.push(`**Fee Amount:** ${formatCurrency(deal.fee_amount, deal.fee_currency)}`);
  terms.push(`**Fee Schedule:** ${deal.fee_schedule}`);
  terms.push(`**Recoupable Percentage:** ${(parseFloat(deal.percent_recoupable) * 100).toFixed(2)}%`);

  // Add master agreement details if available
  if (deal.master_agreements && deal.master_agreements.length > 0) {
    const ma = deal.master_agreements[0];
    terms.push(`**Master Agreement Status:** ${ma.status}`);
    terms.push(`**Master Royalty:** ${(ma.master_royalty * 100).toFixed(1)}%`);
    if (ma.fee) {
      terms.push(`**Master Agreement Fee:** ${formatCurrency(ma.fee, deal.fee_currency)}`);
    }
  }

  return terms.join('\n');
}

// Helper function to extract all masters from master agreements
function extractMasters(masterAgreements) {
  if (!masterAgreements || masterAgreements.length === 0) {
    return 'N/A';
  }

  const masters = masterAgreements
    .filter(ma => ma.master_name && ma.master_name.trim())
    .map(ma => ma.master_name.trim());

  return masters.length > 0 ? masters.join(', ') : 'N/A';
}

// Helper function to get person/performer name (whichever is not null)
function getPersonOrPerformerName(deal) {
  // Prioritize person_name, fallback to performer_name if available
  if (deal.person_name && deal.person_name.trim()) {
    return deal.person_name.trim();
  }

  // If you have performer_name field in your data structure
  if (deal.performer_name && deal.performer_name.trim()) {
    return deal.performer_name.trim();
  }

  return 'N/A';
}

// Modified helper function to create simplified markdown table for confirmation
function createSimplifiedDealsTable(deals) {
  let table = "| Deal ID | Person/Performer | Title | Status | Payment Status | Masters |\n";
  table += "|---------|------------------|-------|--------|----------------|----------|\n";

  deals.forEach((deal) => {
    const personName = getPersonOrPerformerName(deal);
    const masters = extractMasters(deal.master_agreements);

    table += `| ${deal.id || 'N/A'} | ${personName} | ${deal.title || 'N/A'} | ${deal.status || 'N/A'} | ${deal.payment_status || 'N/A'} | ${masters} |\n`;
  });

  return table;
}

// Helper function to check if a value is unknown/missing
function isUnknown(value) {
  return !value || value.trim() === "" || value.toLowerCase().includes("unknown");
}

// Helper function to generate context message for unknown masters/artists
function generateUnknownContextMessage(artistName, masters) {
  let contextMessage = "";
  const unknownArtist = isUnknown(artistName);
  const unknownMasters = isUnknown(masters);

  if (unknownArtist && unknownMasters) {
    contextMessage = "No artist names or master names were found in the conversation, however here are some deals which may be relevant. ";
  } else if (unknownArtist) {
    contextMessage = `No artist names were found in the conversation (masters: ${masters}), however here are some deals which may be relevant. `;
  } else if (unknownMasters) {
    contextMessage = `No master names were found in the conversation (artist: ${artistName}), however here are some deals which may be relevant. `;
  }

  return contextMessage;
}

// UPDATED: Helper function to remove duplicates by deal_number and generate metadata array
function generateDealMetadata(deals, personName, artistName, masters) {
  if (!deals || deals.length === 0) {
    return [];
  }

  // Remove duplicates by deal_number, keeping first occurrence
  const uniqueDeals = Array.from(
    new Map(
      deals
        .filter(deal => deal.number) // Filter out deals without deal_number
        .map(deal => [deal.number, deal])
    ).values()
  );

  // If no valid deals after deduplication, return empty array
  if (uniqueDeals.length === 0) {
    return [];
  }

  // Return list of all unique deals as objects
  return uniqueDeals.map(deal => ({
    deal_id: deal.id || "",
    deal_number: deal.number || "",
    person_name: personName || "",
    artist_name: artistName || "",
    masters: masters || "",
    status: deal.status || "",
    payment_status: deal.payment_status || ""
  }));
}

// Process based on route
const route = inputData.route || "";
const personName = inputData.person_name || "Unknown Person";
const artistName = inputData.artist_name || "Unknown Artist";
const masters = inputData["master(s)"] || "Unknown Masters";
const role = inputData.role || "Client";

switch(route.toLowerCase()) {
  case "proceed":
    // Get the first deal from the list
    if (inputData.deals && inputData.deals.length > 0) {
      const deal = inputData.deals[0];
      const currentTerms = formatDealTerms(deal);

      // Generate metadata for ALL deals (deduplicated)
      output.deal_metadata = generateDealMetadata(inputData.deals, personName, artistName, masters);

      let dealDescription;

      // Check if this is a confirmed deal by ID
      if (inputData.confirmed_by_id === true) {
        // Special message for deals confirmed by manager-provided ID
        dealDescription = `Below deal was identified for the provided Deal ID:`;
      } else {
        // Original logic for score-based matches
        const unknownContext = generateUnknownContextMessage(artistName, masters);

        dealDescription = `Below deal was located and identified for ${role} ${personName}`;
        if (!isUnknown(artistName)) {
          dealDescription += ` with ${artistName}`;
        }
        if (!isUnknown(masters)) {
          dealDescription += ` for the master(s): ${masters}`;
        }
        dealDescription += ".";

        if (unknownContext) {
          dealDescription = unknownContext + "\n\n" + dealDescription;
        }
      }

      // Check if deal is fully executed
      if (deal.status === "Fully Executed") {
        output.deal_search_output = `${dealDescription}\n\n${currentTerms}\n\This deal is **Fully Executed** with no further processing needed.`;
        output.next_route = "no_action";
      } else {
        output.deal_search_output = `${dealDescription}\n\n${currentTerms}\n\n Analyse the 'Email Thread' and/or 'Deal Document' with the current terms(which are last updated at: ${deal.status_updated_at}). Compare the provided terms with the latest negotiations and discussions and propose any agreed upon changes to 'Current Terms' by all the parties in the email discussions. The current terms are as provided: \n\n Current Terms: \n- Fee Amount: ${formatCurrency(deal.fee_amount, deal.fee_currency)} \n- Status: ${deal.status} \n-Payment Status**: "${deal.payment_status}" \n Fee Schedule: ${deal.fee_schedule} \n Percent Recouplable: ${deal.percent_recoupable} \n Kill Fee Amount: ${deal.kill_fee_amount}. If any changes are identified compared to the 'Email Thread/Deal Document' Set deal_update = 'update'. If all the current terms are in sync with the 'Email Thread/Document', set the  deal_update = 'not_update'.`;
        output.next_route = "update";
      }
    } else {
      output.deal_search_output = "No deals found in the input data. Please verify the data source.";
      output.next_route = "error";
      output.deal_metadata = [];
    }
    break;

  case "confirm":
    // Use simplified table for confirmation with only required fields
    if (inputData.deals && inputData.deals.length > 0) {
      // Generate metadata for ALL deals (deduplicated)
      const metadata = generateDealMetadata(inputData.deals, personName, artistName, masters);
      output.deal_metadata = metadata;

      // Check if metadata generation was successful
      if (metadata.length === 0) {
        output.deal_search_output = "No valid deals found to confirm. Please verify the data source.";
        output.next_route = "error";
      } else {
        // Sort deals by ID for display
        const sortedDeals = [...inputData.deals].sort((a, b) => 
          String(a.id).localeCompare(String(b.id))
        );

        const dealsTable = createSimplifiedDealsTable(sortedDeals);
        const unknownContext = generateUnknownContextMessage(artistName, masters);

        let dealDescription = `The following deals for ${role} ${personName}`;
        if (!isUnknown(artistName)) {
          dealDescription += ` with ${artistName}`;
        }
        if (!isUnknown(masters)) {
          dealDescription += ` for ${masters}`;
        }
        dealDescription += "which could be related to the the Email Thread Discussion.:";

        if (unknownContext) {
          dealDescription = unknownContext + "\n\n" + dealDescription;
        }

        output.deal_search_output = `${dealDescription}\n\n${dealsTable}\n\n There is explict deal selection needed by Deal ID to propose any further actions and updates.`;
        output.next_route = "confirm";
      }
    } else {
      output.deal_search_output = "No deals found to confirm. Please verify the data source.";
      output.next_route = "error";
      output.deal_metadata = [];
    }
    break;

  case "discard":
