  // Remove leading zeros from deal_id
  const dealIdFromTrigger = String(trigger_input.data.deal_id).replace(/^0+/, '') || '0';

  // Filter deal_metadata if it exists
  if (validatedSession.deal_metadata && Array.isArray(validatedSession.deal_metadata)) {
    validatedSession.deal_metadata = validatedSession.deal_metadata.filter(deal => {
      if (deal.deal_number) {
        // Remove leading zeros from deal_number for comparison
        const dealNumber = String(deal.deal_number).replace(/^0+/, '') || '0';
        return dealNumber === dealIdFromTrigger;
      }
      return false;
    });
  } else {
    // If deal_metadata doesn't exist or isn't an array, set it to empty array
    validatedSession.deal_metadata = [];
  }
} else {
  // If deal_id is empty or null, set deal_metadata to empty array
  validatedSession.deal_metadata = [];
}

// Ensure trigger_input has metadata object
if (!trigger_input.data.metadata) {
